import React, {Fragment}  from 'react';
import {Link} from 'react-router-dom';

const Ship = (props) => {
const url = "/ship/" + props.ship.id;
		return (
			<Fragment className="component">
	      <Link to={url} className="name">
	        {props.ship.name}
	      </Link>
	    </Fragment>
		)
	}

export default Ship;
